import React from "react";
import Avatar from "./Avatar";
import Detail from "./Detail";

function Card(props) {
  return (
    <div className="card">
        <Avatar img={props.img} />
        <h3>{props.name}</h3>
        <h2>{props.heading}</h2>
    </div>
  );
}

export default Card;
